// MOUSE CIRCLE
var $circle = $('.circle'),
    $follow = $('.circle-follow');

function moveCircle(e) {
	TweenLite.to($circle, 0.7, {
      x: e.clientX,
      y: e.clientY
  });
	TweenLite.to($follow, 0.7, {
      x: e.clientX,
      y: e.clientY
  });  
}

function hoverFunc(e) {
  TweenLite.to($circle, 0.5, {
    opacity: 1,
    scale: 0
  });
  TweenLite.to($follow, 0.5, {
	  opacity: 1,
	  scale: 1
  });  
}

function unhoverFunc(e) {
  TweenLite.to($circle, 0.5, {
    opacity: 1,
    scale: 1
  });
  TweenLite.to($follow, 0.5, {
      scale: 0
  });  
}

$(window).on('mousemove', moveCircle);

$("a").hover(hoverFunc, unhoverFunc);
$("button").hover(hoverFunc, unhoverFunc);
// MOUSE CIRCLE END

$(document).ready(function () {
	$("body").css({'visibility': "visible", "opacity": "1"});
	
	$('html').addClass('no-scroll')

	

	let big = 'static/js/separate-js/big.js';	

	$('.js-accept').click(function() {
		function scriptLoadCurrect() {
			loadScript(big)
			.then(function() {
				console.log('big loaded');
			})
			.catch(function() {
				console.log('big not loaded');
			})
        }
        scriptLoadCurrect()
	})

    

})




